window.bookSummaryJSON = "<p>Gaia has awakened, and the world will never be the same again</p> <p>Rockland Barkclay has had a rough year. On top of everything else, his father has just passed, and Rocky has to go it alone on their annual trip. But his plans for drinking alone in Algonquin Park are rudely interrupted by a sea of cosmic energy that governs the universe. Ether, the driving force of creation, has returned. Now a confused Rocky must navigate odd hovering messages to survive.</p> <p>With the awakening of the very planet they reside on, humans are in a desperate fight to survive in an evolving world. If only Gaia hadnâ€™t woken up so very...very...unhinged.</p>"; 
